package com.webweeb.backend.entity;import jakarta.persistence.*;import lombok.*;import java.time.LocalDateTime;@EqualsAndHashCode(callSuper = true)@Entity@Data@AllArgsConstructor@NoArgsConstructor@Builder@Table(name = "\"PasswordHistory\"")public class PasswordHistory extends BaseEntity {    @Column(nullable = false)    private LocalDateTime changeDate;    @Column(nullable = false)    private String password;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "password_account_id", referencedColumnName = "id")    private PasswordAccount passwordAccount;}